import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./tem.css";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
function Page1() {
    return (
        <div>
            <div className='bg-img'>
            <Navbar collapseOnSelect expand="lg"  data-bs-theme="dark">
      <Container fluid>
        <Navbar.Brand href="#home" className='head logo'>NEOGYM</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav" className="justify-content-end">
          <Nav>
            <Nav.Link href="#Home.jsx" className='nav nav-items px-5'>Home</Nav.Link>  
             <Nav.Link href="#page2" className='nav nav-items  '>why us</Nav.Link>
              <Nav.Link href="#pricing" className='nav nav-items'>trainers</Nav.Link>
             <Nav.Link href="#pricing" className='nav nav-items'>Contact Us</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
    </div>
           </div>

    )
}
export default Page1;
